function Header() {

    // const handleMouseOver = (e) => {

    // }

    return (
        <header className="header-header">
            <nav className="navbar left-nav">
                <a href="#" className="link shop-link" onMouseMove={handleMouseOver()}>Shop</a>
                <a href="#" className="link Blog-link" onMouseMove={handleMouseOver()}>Blog</a>
                <a href="#" className="link Contact-link" onMouseMove={handleMouseOver()}>Contact</a>
            </nav>
            <div className="logo-container">
                <a href="#" className="logo">Logo</a>
            </div>
            <nav className="navbar right-nav">
                <a href="#" className="link search-icon-link"><span class="material-symbols-outlined">search</span></a>
                <a href="#" className="link account-icon-link">
                <span class="material-symbols-outlined">person</span></a>
                <a href="#" className="link cart-icon-link"><span class="material-symbols-outlined">shopping_bag</span></a>
            </nav>
        </header>
    );
}

export default Header;
